import React, { Component } from 'react';
import { Link } from "react-router-dom";

let navitems = [
    {
        name: "Home",
        url : "/"
    },
    {
        name: "Login",
        url : "/login"
    },
    {
        name: "Signup",
        url : "/signup"
    },
    {
        name: "Profile",
        url : "/profile"
    }, 
    {
        name: "Logout",
        url : "/logout"
    }, 
];



class Navbar extends Component {
    constructor(props){
        super(props);
        this.state = {
            navitems:[]
        } 
    }
    render() {
        return this.state.navitems.map( nav => {
            return(
                <div>
              <div key={nav.name} className="item-card">
                 <div className="info">    
                      <div className="username">Username: {nav.name}</div>
                 </div>
              </div>
              </div>
              );
          }
        )
    };
}

export default Navbar;
